import { Provider } from "react-redux";
import { store } from "../store/store";
import WidgetBox from "./WidgetBox/WidgetBox";

const App = () => {
  return (
    <Provider store={store}>
      <WidgetBox />
    </Provider>
  );
};

export default App;
